  \"Advanced Simulation Capability for Turbopump Cavitation Dynamics Guided by Experimental
  Validation Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 13,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2015-05-07T01:21:33.001598\",\n\t\"name\": \"advanced-simulation-capability-for-turbopump-cavitation-dynamics-guided-by-experimental-va\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Numerical cavitation modeling capability
  is critical in the design of liquid rocket engine turbopumps, feed lines, injector
  manifolds and engine test facilities. Cavitation in turbopumps leads to reduced
  performance, mechanical vibrations, and component erosion. The Computational Fluid
  Dynamics (CFD) solver Loci-STREAM&amp;#150;developed by Streamline Numerics&amp;#150;is
  one of the primary production tools currently used at NASA to simulate turbopumps.
  \ With a long term goal of enabling accurate computational modeling of cavitating
  turbopumps subjected to an array of potential operating conditions, this project
  is aimed at enhancing the cavitation modeling capability in Loci-STREAM to enable
  time-accurate simulations involving complex engineering geometries present in turbopumps
  of relevance to NASA involving cryogenic fluids (LOX, LH2, LCH4, RP-1, RP-2). This
  will contribute to enhanced performance, reliability and reduced developmental costs
  of liquid rocket pumps. The project will involve a tightly coupled experimental/computational
  effort.  The experimental simulations will be conducted at the University of Florida
  in a dedicated experimental facility capable of investigating various cavitation
  modes covering the entire range of non-cryogenic to cryogenic fluids; the proposed
  studies will be supported by extensive instrumentation.  The cavitation models in
  Loci-STREAM will be substantively validated via dedicated experimental data directed
  by the computational and model requirements.\",\n\t\"license_title\": \"U.S. Government
